import SignUpImg from "../asset/2.svg";
import { Link } from "react-router-dom";
import "../style/Login.css";
import { auth } from "../config/firebase";
import { createUserWithEmailAndPassword } from "firebase/auth";

const SignUp = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const handleSubmit = (e) => {
    e.preventDefault();
    createUserWithEmailAndPassword(auth, email, password)
      .then((userCredential) => {
        console.log(userCredential);
        alert("check your email");
      })
      .catch((error) => {
        console.log(error);
      });
  };
  return (
    <div className="login-container">
      <div className="my-text">Masak Yuk</div>
      <div className="box-container">
        <div className="img-container">
          <img src={SignUpImg} alt="" className="login-img" />
        </div>
        <div className="form-container">
          <div className="form-text">Sign Up</div>
          <form action="" className="form-box">
            <label>
              Email <input type="email" className="email" />
            </label>
            <label>
              Password <input type="password" />
            </label>
            <div>
              Klik untuk membuat akun baru
              <Link to="/" className="link link-signup">
                Sign In
              </Link>
            </div>
            <Link>
              <button className="login-btn">Submit</button>
            </Link>
          </form>
        </div>
      </div>
    </div>
  );
};

export default SignUp;
